% using the 2D Dubin's car model; moving obstalces

IS_DRAW = 0;
IS_ANIMATE = 1;
IS_UNICYCLE = 1;

global last_theta;
global last_dotz;
k11 = 5; k12 = 2;  % path-following vector field gains
k2 = 2;            % reactive vector field gain
l1 = 0.1; l2 = 0.1;             % bump function constants
c = -0.72;          % repulsive bounary \varphi^{-1}(c)
speed = 1;          % unicycle speed
k_theta = 3;        % gain for angular speed control
param={k11, k12, k2, l1, l2, c, speed, k_theta, IS_UNICYCLE};

%% ode45
opts = odeset('AbsTol',1e-15,'MaxStep',0.1);
if(IS_UNICYCLE)
    tspan = [0 30];
    initial = [0.5; -1; 0.3; -pi/2];
    last_theta = initial(end);
    last_dotz = 0;
else
    tspan = [0 30];
    initial = [2; 1; 1];
end
[tout1, p1] = ode45(@(t, p) sim(t,p, param), tspan, initial, opts);
[dpdt, e1] = cellfun(@(t, p) sim(t,p, param), num2cell(tout1), num2cell(p1,2), 'UniformOutput',false);
e1 = cell2mat(e1);
dpdt = cell2mat(dpdt')';


%% plot
tout = tout1;
p = p1;
if(IS_DRAW) 
    i_unicycle_plot; 
end

%% animate
if(IS_ANIMATE)
    i_3Dunicycle_animate;
end

